CREATE DATABASE homes;
use homes;

CREATE TABLE IF NOT EXISTS tblhomesImport (
    `Sell` VARCHAR(3) CHARACTER SET utf8,
    `List` INT,
    `Living` INT,
    `Rooms` INT,
    `Beds` INT,
    `Baths` INT,
    `Age` INT,
    `Acres` NUMERIC(3, 2),
    `Taxes` INT,
    `id` INT AUTO_INCREMENT,
    PRIMARY KEY (`id`)
);
